import React from 'react';
import Link from '../../Link';
import '.RepositoryItem.css';

const RepositoryItem = ({
  name,
  url,
  descriptionHTML,
  primaryLanguage,
  owner,
  stargazers,
  watchers,
  viewerSubscription,
  viewerHasStarred,
}) => (
  <div>
    <div className="RepositoryItem-title">
      <h2><Link href={url}>{name}</Link></h2>
    </div>
  </div>
)
